import React from 'react'
import './page-icon.css'

const PageIcon = ({imageURL,pageName, pageSwitchingEvent}) => {
     return (
          <div className='icon-container' onClick={pageSwitchingEvent(pageName)}>
               <img src = {imageURL} width = '40px' height = 'auto' />
               <div className='page-name'> {pageName} </div>
          </div>
     )
}

export default PageIcon
